import {
    SET_PAGE_CONTENT,
} from '../utils/constants';

import burgerBuns from '../json/burgerBuns.json.json';

export const setPageContent = (dispatch, burgerBuns) => {
    dispatch({
        type: SET_PAGE_CONTENT,
        payload: { burgerBuns },
    });
}
